import { FuseLoadable } from "owp/@fuse";
import { authRoles } from "owp/auth";

export const Error404PageConfig = {
    settings: {
        layout: {
            config: {},
        },
    },
    //uth: authRoles.user,
    routes: [
        {
            path: '/pages/errors/error-404',
            component: FuseLoadable({
                loader: () => import('./Error404Page'),
            }),
        },
    ],
};
